INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(6, 'Porto de Galinhas', 'Piscinas naturais, jangadas coloridas e um mar cristalino. Esse é o cenário de Porto de Galinhas, localizada em Pernambuco, no município de Ipojuca, a 66 km da capital Recife. Um dos destinos mais badalados do Nordeste, já foi eleita como melhor destino de praia do Brasil por 10 anos consecutivos pelos leitores da revista “Viagem e Turismo” e sempre aparece nas listas das praias mais lindas do país.', 'Localizacao', 4200, 0, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(8, 'Rio de Janeiro', 'O Rio de Janeiro, conhecido como a Cidade Maravilhosa, é uma sinfonia de beleza natural e vibrante cultura. Com suas praias icônicas, como Copacabana e Ipanema, e o imponente Pão de Açúcar, o Rio é uma celebração da vida ao ar livre. A atmosfera descontraída, a música pulsante e as cores vibrantes do Carnaval refletem o espírito acolhedor dessa cidade única. Descubra o encanto do Rio de Janeiro, onde a natureza e a alegria se encontram.', 'Localizacao', 4500, 0, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(9, 'Gramado', 'Bem-vindo a Gramado, um destino onde a magia se entrelaça com a beleza natural. Aninhada na Serra Gaúcha, esta charmosa cidade é um convite para vivenciar experiências únicas. Passeie por ruas floridas, explore a arquitetura europeia e entregue-se ao aconchego dos cafés. Descubra a magia do Natal Luz, encante-se com os espetáculos e delicie-se com as delícias gastronômicas. Gramado, onde cada esquina é uma história a ser contada.', 'Localizacao', 5200, 0, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(10, 'Cancún', 'Cancún, um paraíso tropical que deslumbra com suas praias de areias brancas e águas cristalinas do Caribe. Este destino, situado na península de Yucatán, é um convite para explorar o extraordinário. Com resorts luxuosos à beira-mar, Cancún é sinônimo de relaxamento e indulgência.', 'Localizacao', 7000, 1, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(11, 'Las Vegas', 'Las Vegas, a cidade que nunca dorme, onde os sonhos se tornam realidade sob as luzes cintilantes da famosa Las Vegas Strip. Esta capital do entretenimento é conhecida por seus cassinos deslumbrantes, shows espetaculares e vida noturna animada. ', 'Localizacao', 8000, 1, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(12, 'Tóquio', 'Tóquio, a metrópole futurista que equilibra a tradição com a modernidade. Nesta vibrante capital japonesa, arranha-céus imponentes dividem espaço com santuários históricos e jardins serenos. Explore bairros icônicos como Shibuya, conhecido pelo cruzamento movimentado, e Akihabara, o paraíso tecnológico.', 'Localizacao', 9000, 1, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(14, 'Recife', 'À beira-mar e cortada pelos rios Capibaribe e Beberibe, a capital de Pernambuco é uma das principais cidades do Nordeste, repleta de atrações culturais, atrações históricas e muita animação - lá é a terra do frevo! Com o apelido de \"Veneza Brasileira\", Recife conta com uma geografia singular, com várias ilhas, canais e pontes. Seu conjunto arquitetônico impressiona, como o Espaço Cultural Pátio de São Pedro, charmoso casario oitocentista e a imponente Catedral de São Pedro dos Clérigos, que conferem ao conjunto arquitetônico da cidade traços portugueses.', 'Localizacao', 6000, 0, );
INSERT INTO `destino` (`id`, `nome`, `descricao`, `localizacao`, `preco_medio`, `internacional`, `imagem`) VALUES
(15, 'Salvador', 'Explore a cidade onde a cultura, a música e a alegria se encontram: Salvador, a Terra de Todos os Santos. Com um toque de axé, sol brilhante e praias deslumbrantes, Salvador é uma experiência única. Percorra as encantadoras ruas de pedra do Pelourinho, maravilhe-se com a vista panorâmica do Elevador Lacerda e entregue-se às areias douradas das diversas praias da cidade. No Carnaval, Salvador ganha vida de uma maneira única e incomparável, tornando-se o destino mais animado do país. Prepare-se para dançar, sorrir e celebrar nessa cidade que respira festividade durante todo o ano.', 'Localizacao', 5800, 0, );

